	(25,25,'','##certificate.action##  ##certificate.entity##','##lang.certificate.entity## : ##certificate.entity##\n\n##FOREACHcertificates##\n\n##lang.certificate.serial## : ##certificate.serial##\n\n##lang.certificate.expirationdate## : ##certificate.expirationdate##\n\n##certificate.url##\n ##ENDFOREACHcertificates##','&lt;p&gt;\n##lang.certificate.entity## : ##certificate.entity##&lt;br /&gt;\n##FOREACHcertificates##\n&lt;br /&gt;##lang.certificate.name## : ##certificate.name##&lt;br /&gt;\n##lang.certificate.serial## : ##certificate.serial##&lt;br /&gt;\n##lang.certificate.expirationdate## : ##certificate.expirationdate##\n&lt;br /&gt; &lt;a href=\"##certificate.url##\"&gt; ##certificate.url##\n&lt;/a&gt;&lt;br /&gt; ##ENDFOREACHcertificates##&lt;/p&gt;'),
	(26,26,'','You have been invited to join Flyve MDM','Hi,\n\n##user.firstname## ##user.realname## invited you to enroll your mobile device\nin Flyve Mobile Device Managment (Flyve MDM). Flyve MDM allows administrators\nto easily manage and administrate mobile devices. For more information,\nplease contact ##user.firstname## ##user.realname## to his email address\n##user.email##.\n\nPlease join the Flyve Mobile Device Management system by downloading\nand installing the Flyve MDM application for Android from the following link.\n\n##flyvemdm.download_app##\n\nIf you\'re viewing this email from a computer flash the QR code you see below\nwith the Flyve MDM Application.\n\nIf you\'re viewing this email from your device to enroll then tap the\nfollowing link or copy it to your browser.\n\n##flyvemdm.enroll_url##\n\nRegards,\n\n','&lt;p&gt;&lt;p&gt;Hi,&lt;/p&gt;&lt;p&gt;##user.firstname## ##user.realname## invited you to enroll your mobile device&lt;br&gt;in Flyve Mobile Device Managment (Flyve MDM). Flyve MDM allows administrators&lt;br&gt;to easily manage and administrate mobile devices. For more information,&lt;br&gt;please contact ##user.firstname## ##user.realname## to his email address&lt;br&gt;&lt;a href=\"mailto:##user.email##?subject=Questions about Flyve MDM\"&gt;&lt;br&gt;##user.email##&lt;/a&gt;.&lt;/p&gt;&lt;p&gt;Please join the Flyve Mobile Device Management system by downloading&lt;br&gt;and installing the Flyve MDM application for Android from the following link.&lt;/p&gt;&lt;p&gt;&lt;a href=\"##flyvemdm.download_app##\"&gt;##flyvemdm.download_app##&lt;/a&gt;&lt;/p&gt;&lt;p&gt;If you\'re viewing this email from a computer flash the QR code you see below&lt;br&gt;with the Flyve MDM Application.&lt;/p&gt;&lt;p&gt;If you\'re viewing this email from your device to enroll then tap the&lt;br&gt;following link or copy it to your browser.&lt;/p&gt;&lt;p&gt;&lt;a href=\"##flyvemdm.enroll_url##\"&gt;##flyvemdm.enroll_url##&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=\"cid:##flyvemdm.qrcode##\" alt=\"Enroll QRCode\" title=\"Enroll QRCode\"&gt;&lt;/p&gt;&lt;p&gt;Regards,&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;/p&gt;');
